                                df_tracks.loc[df_tracks["Condition"] == cond, "Condition color"] = color
                                df_frames.loc[df_frames["Condition"] == cond, "Condition color"] = color
                                df_tintervals.loc[df_tintervals["Condition"] == cond, "Condition color"] = color

