        # Clamp index to valid range
        idx = max(0, min(int(input.frame_replay()) - 1, len(frames) - 1))
        src = frames[idx]
        return ui.img(
            # {"src": src, "width": 800, "height": 600, "style": "display:block;"}
            {"src": src, "style": "display:block;"}
        )

